import React from "react";

const Footer = () => {
    return (
        <div>
            <footer className="page-footer bg-dark">
                <div className="bg-success">
                    <div className="container">
                        <div className="row py-3 d-flex align-items-center">
                            
                        </div>
                    </div>
                </div>
            </footer>
        </div>
    );
};
export default Footer;
